import { Button, Table } from 'antd';
import axios from 'axios';
import { useEffect, useState } from 'react';
import url from '../components/host';
import { AiOutlineCheck, AiOutlineClose } from "react-icons/ai";
import "./style/style.css"





const Tables = () => {
  const [ setSelectedRowKeys] = useState([]);
  const [setLoading] = useState(false);
  const [data, setdata] = useState([])
  const [data1, setdata1] = useState([])

  const [page, setPage] = useState(1)

  const columns = [
    {
      title: 'Id',
      dataIndex: 'id',
    },
    {
      title: 'Name',
      dataIndex: 'name',
    },
    {
      title: 'Price',
      dataIndex: 'price',
    },
    {
      title: 'Status',
      dataIndex: 'is_active',
      render: (el) => <div  >{el ? (<h1 style={{ color: "green" }}><AiOutlineCheck /></h1>) : (<h1 style={{ color: "red" }} ><AiOutlineClose /></h1>)}</div>


    },
    {
      title: "Ma'lumot",
      key: "edit",
      width: "5%",
      render: (__, item) => {
        return <div><Button onClick={() => { getOneProduct(item) }} style={{ background: 'orange', color: 'white' }} type="text">Ma'lumot</Button></div>
      }
    },
    {
      title: "Edit",
      key: "edit",
      width: "5%",
      render: () => {
        return <div><Button style={{ background: 'orange', color: 'white' }} type="danger">O'zgartirish</Button></div>
      }
    },
    {
      title: "Delete",
      key: "delete",
      width: "5%",
      render: () => {
        return <div><Button onClick={() => { deletedata() }} type="danger">O'chirish</Button></div>
      }
    },
  ];

  const getOneProduct = (item) => {
    setdata(item)
    console.log(data,"shshshshh");
    setPage(2)
    console.log(item);

  }

  function getData() {
    axios.get(`${url}/api/cars/`).then(res => {
      setdata1(res.data)
    })
  }
  useEffect(() => {
    getData()
  }, [])


  deletedata=(id)=>{
    axios.delete(`${url}/api/cars/${id}`).then(res=>{
      window.location.reload()
    }).catch(err=>{
      alert("ishlamadi")
    })
  }

  const start = () => {
    setLoading(true);
    // ajax request after empty completing
    setTimeout(() => {
      setSelectedRowKeys([]);
      setLoading(false);
    }, 100);
  };




  return (
    <div>
      {page==1?(<Table className='table' columns={columns} dataSource={data1} />) : (
        <div>
          <div className="nomi1">
          <h1 className='nomi'>{data.name}</h1>
          <Button onClick={()=>(setPage(1))} type="danger">Orqaga</Button>
          </div>
          <div className="alltext">
            <div className="alltext2">
            <div className="alltext1">
          <div className="text1">
          <div className="text">
          <h1>Pozitsiya</h1>
          <input type="text" value={data.position.name} id='inp1' />
          </div>
          <div className="text">
            <h1>Seriya</h1>
            <input type="text" value={data.position.series.name} />
          </div>
          <div className="text">
            <h1>Model</h1>
            <input type="text" value={data.position.series.model.name} />
          </div>
          <div className="text">
            <h1>Yoqilg'i turi</h1>
            <input type="text" value={data.fuel_sort.name} />
          </div>
          <div className="text">
            <h1>Vites qutisi</h1> 
            <input type="text" value={data.gearbox.name} />
          </div>
          <div className="text">
            <h1>Garant</h1> 
            <input type="text" value={data.garant.name} />
            <h1>Garant Soat</h1>
            <input type="text" value={data.garant.time} />
          </div>
          </div>
          <div className="text2">
            <div className="text">
              <h1>Filial</h1>
              <input type="text" value={data.branch.name} />
            </div>
            <div className="text">
              <h1>Mamlakat</h1>
              <input type="text" value={data.branch.country} />
            </div>
            <div className="text">
              <h1>Mintaqa</h1>
              <input type="text" value={data.branch.region} />
            </div>
            <div className="text">
              <h1>Shahar</h1>
              <input type="text" value={data.branch.city} />
            </div>
            <div className="text">
              <h1>Tuman</h1>
              <input type="text" value={data.branch.district} />
            </div>
            <div className="text">
              <h1>Ko'cha</h1>
              <input type="text" value={data.branch.street} />
            </div>
            <div className="text">
                <h1>Ko'rishlar</h1>
                <input type="text" value={data.views}/>
              </div>          
          </div>
          </div>
          <div className="textsmall">
            <h1>Tavsifi</h1>
            <textarea id="w3review" rows="19" value={data.description} cols="101"></textarea>
          </div>
          </div>
          <div className="text3">
              <div className="text">
                <h1>Ism</h1>
                <input type="text" value={data.name}/>
              </div>
              <div className="text">
                <h1>Boshlang'ich_narx</h1>
                <input type="text" value={data.initial_price}/>
              </div>
              <div className="text">
                <h1>Narx</h1>
                <input type="text" value={data.price} />
              </div>
              <div className="text">
                <h1>Sotuv</h1>
                <input type="text" value={data.sale} />
              </div>
              <div className="text">
                <h1>Depozit</h1>
                <input type="text" value={data.depozit} />
              </div>
              <div className="text">
                <h1>Yoqilg'i iste'moli</h1>
                <input type="text" value={data.fuel_consumption} />
              </div>
              <div className="text">
                <h1>Yili</h1>
                <input type="text" value={data.year}/>
              </div>
              <div className="text">
                <h1>Masofa</h1>
                <input type="text" value={data.distance}/>
              </div>
              <div className="text">
                <h1>Dvigatel</h1>
                <input type="text" value={data.engine}/>
              </div>
              <div className="text">
                <h1>Rang</h1>
                <input type="text" value={data.colour}/>
              </div>
              <div className="text">
                <h1>Vaqt_yaratilgan</h1>
                <input type="text" value={data.time_create}/>
              </div>
              <div className="text">
                <h1>Vaqtni yangilangan</h1>
                <input type="text" value={data.time_update}/>
              </div>
              <div className="text">
                <h1>Faol</h1>
                <input type="text" value={data.is_active}/>
              </div>
            </div>
          </div>
        </div>
        )
      }


    </div>
  );
};
export default Tables;
